import React from "react";
import "./Header.css";

function SideBar() {
  return (
    <div>
      <div className="mail_button">
        <button className="py-4">메일 쓰기</button>
        <button className="border-l-[0.5px] border-gray-500">내게 쓰기</button>
      </div>
    </div>
  );
}

export default SideBar;
